import { createStore } from "vuex";
import {favoriteModule} from "@/store/favoriteModule";
import {mapCheckModule} from "@/store/mapCheckModule"; 
import {dateModule} from "@/st"

export default createStore({
  modules: {
    favorite: favoriteModule,
    map: mapCheckModule
  }
})
